package main

import (
	"fmt"
	"strings"
)

const alpha = "abcdefghijklmnopqrstuvwxyz"

func removeReactingUnit(input, c string) (string, bool) {
	hasUnit := false
	output := input

	combos := []string{c + strings.ToUpper(c), strings.ToUpper(c) + c}
	for _, combo := range combos {
		if strings.Contains(output, combo) {
			hasUnit = true
			output = strings.Replace(output, combo, "", -1)
		}
	}

	return output, hasUnit
}

func removeReactingUnits(input string) (string, bool) {
	hasUnit := false
	output := input

	chars := strings.Split(alpha, "")

	for _, c := range chars {
		var iHasUnit bool
		output, iHasUnit = removeReactingUnit(output, c)
		if iHasUnit {
			hasUnit = true
		}
	}

	return output, hasUnit
}

func main() {
	output, hasUnit := removeReactingUnits(input)
	for hasUnit {
		output, hasUnit = removeReactingUnits(output)
	}

	fmt.Printf("Part1: %d\n", len(output))

	smallestOutput := ""

	chars := strings.Split(alpha, "")

	for _, c := range chars {
		output2 := strings.Replace(input, c, "", -1)
		output2 = strings.Replace(output2, strings.ToUpper(c), "", -1)

		output2, hasUnit := removeReactingUnits(output2)
		for hasUnit {
			output2, hasUnit = removeReactingUnits(output2)
		}

		if len(output2) < len(smallestOutput) || smallestOutput == "" {
			smallestOutput = output2
		}
	}

	smallestOutput, hasUnit = removeReactingUnits(smallestOutput)
	for hasUnit {
		smallestOutput, hasUnit = removeReactingUnits(smallestOutput)
	}

	fmt.Printf("Part2: %d\n", len(smallestOutput))
}

